import React from "react";
import { useHistory } from "react-router-dom";
import "./header.css";

function Header() {
  const history = useHistory();

  const handleLogout = () => {
    // 로그아웃 로직을 구현합니다.
    // 예를 들어, 세션 정보를 삭제하거나 토큰을 무효화할 수 있습니다.
    // 사용자 로그아웃 후, 로그인 페이지로 리디렉션할 수 있습니다.

    // 로그아웃 로직이 완료되면, 아래의 코드를 사용하여 로그인 페이지로 이동합니다.
    history.push("/login"); // "/login"은 로그인 페이지의 경로입니다.
  };

  return (
    <div className="navbar">
      {/* 헤더 메뉴 */}
      <header className="header-set align-center">
        <div className="align-center ">
          <div className="logo_img Title"></div>
        </div>
        <div className="align-center Tag-list">
          <div className="align-center Tag">홈</div>
          <div className="align-center Tag">플래너</div>
          <div className="align-center Tag">경비계산 / 준비물</div>
          <div className="align-center Tag">관광지</div>
          <div className="align-center Tag">커뮤니티</div>
          <div className="align-center Tag" onClick={handleLogout}>
            로그아웃
          </div>
        </div>
      </header>
    </div>
  );
}

export default Header;
